import Hero from "../components/Hero";
import Navbar from "../components/Navbar"
import Footer from "../components/Footer";
import AboutUsPage from "../components/Visualize";

function Visualization(){
    return(
        <>
        <Navbar /> 
        <Hero 
        cName="hero-mid"
        heroImg = {AboutImg}
        title = "About"
        btnClass="hide"/>
        <AboutUsPage />
        <Footer />
        </>
    )
}

export default Visualization;
